    return(
        <React.Fragment>
            <div className="p-3">
                <div className="row">
                    <dic className="col-md-5">
                        <div className="card-body">
                        <p className="pizza">Pizza</p>
                            <p className="lead">this is new pizza in store </p>
                             <img src=""/>
                            </div>
                    </dic>
                </div>
            </div>
            
        </React.Fragment>
    )
}
export default pizzaHurt;
